import React from "react";
import { Link } from "react-router-dom";


const SingleRoom = () => {
    return(
        <div>
             <div className="overlay">
                <img className="room-image" src={`${process.env.PUBLIC_URL}/vivian-source/single1.jpg`} alt="Room" />
                <div className="text-overlay">Phòng Riêng</div>
            </div>

            <h1>Room Information</h1><hr></hr>
            <div className="room-explain">
                <ul className="room-info">
                    <li><p >Thông tin phòng</p></li>
                    <li><p >Thông tin phòng</p></li>
                    <li><p >Thông tin phòng</p></li>
                    <li><p >Thông tin phòng</p></li>
                </ul>

                <div className="room-price">
                    <h2>500.000 vnd | 2 Person | Night</h2>
                    <Link to="/book-room">Đặt Phòng</Link>
                </div>
            </div>
        </div>






    );
};

export default SingleRoom
